        <Link className="card-link" to="/ProductProfile" >
<button type="button" class="btn btn-warning" style={{width:"100px"}}>view Details</button>
</Link>
<Link className="card-link" to="/ProductProfile" >
<button type="button" class="btn btn-danger">view Details</button>
</Link>
        <a href="#" className="card-link">{Price}</a>
        </div>
      </div>
        </div>
        </div>
        </>
